class UmHymnsOkuTavisaUkuekandu {
  static List<HymnsContent> list = [
    HymnsContent(id: 2213, position: 1, content: "Enjui vosi wa yongoli,\nOku ecelua akandu.\nNdaño omanu vo pembula,\nWu ka mola eyovo.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_145, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2214, content: "Yesu u sumuluisi etali;\nEye Ongavi, Ukuahenda,\nEnjui vosi wa yongoli\nOku ecelua akandu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_145, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2215, position: 2, content: "Ko ka soki, hoti, omambo,\nEyi ondaka yocili.\nYesu eye hafufiko;\nO waveli via lova.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_145, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2216, position: 3, content: "Yeveleli, u tinduke,\nKilu vosi wu lipue.\nEnjui ya, ko ka paceli;\nWu ka mola eyovo.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_145, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2217, position: 1, content: "Ku kasi kupãla lusoma wa Suku.\nKu kasi kupãla nye o tatãlela?\nO kasi ocipepi, haimo wa suma.\nWa kamba ño naito. Ku tavela nye?", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_146, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2218, content: "Yesu wa ku peya.\nWa ku peya etaili,\nKu tavela nye?", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_146, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2219, position: 2, content: "Wa kuliha ciwa etateko liove.\nCi kale oviteka, ci kale usumba.\nLitepa la cosi ca ku pandeka.\nNdo tave ku Yesu, hu sangi eyovo.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_146, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2220, position: 3, content: "Limbuka esanda liukuasi woluali.\nOnganyu yakandu okufa luvali.\nEpito liohenda li li upulule.\nYayula oku iñila, hũ moli omuenyo.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_146, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2221, position: 1, content: "Ndomo ñasi, esunga sio,\nLakumue njimba ovaso;\nKokuove lika, Ukueyovo,\nUmola a Suku, nda tava.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_147, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2222, position: 2, content: "Ndomo ñasi, ndukuakandu,\nVutima wosi esunga mbu;\nKokuove muele, Ukuanjelo;\nUmõla a Suku, nda tava.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_147, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2223, position: 3, content: "Ndomo ñasi, ndukuayonjo,\nNda sakalala leviho;\nKokuove wa yula ayonjo,\nUmõla a Suku, nda tava.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_147, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2224, position: 4, content: "Ndomo ñasi, ndukuepele,\nNdisuke, haime ndimeke;\nKokuove momo Upopeli,\nUmõla a Suku, nda tava.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_147, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2225, position: 5, content: "Ndomo ñasi, o nambula;\nAkandu osi o ngecela;\nOhenda yove ya ñoka,\nUmõla a Suku, nda tava.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_147, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2226, position: 1, content: "Komanu owelema wakandu wa lua.\nUtanya woluali Yesu.\nUlamba wa Suku wa tuila vosi.\nUtanya woluali Yesu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_148, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2227, content: "Enju kutanya wa ku tuila.\nNdo limbuka ale; nda sanjuka.\nNda kaile omeke puãi nda kaya.\nUtanya woluali Yesu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_148, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2228, position: 2, content: "Ka ku li uteke nda wo kolela.\nUtanya woluali Yesu.\nTu tungila nye vali vowelema?\nUtanya woluali Yesu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_148, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2229, position: 3, content: "Kilu ka ku kala osai lekumbi.\nUtanya wokilu Yesu.\nKu kala ulamba wa piãla enene.\nUtanya wokilu Yesu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_148, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2230, position: 1, content: "Kofeka yamãle,\nHayo yolohali;\nYevelela ondaka\nYiti, Enju.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_149, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2231, content: "Amolange, enju.\nTiuka kokuange.\nNdaño wa enda kupãla.\nEnju. Enju.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_149, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2232, position: 2, content: "Akamba vove\nVa ku yanduluka.\nAme puãi hu sole,\nAmolange.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_149, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2233, position: 3, content: "Ndaño wa sandola\nOvipako viosi,\nTiuka; nda ku ecela\nAmolange.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_149, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2234, position: 4, content: "Nda yala ale omesa\nLevi via posoka.\nNye o lambukila,\nAmolange?", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_149, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2235, position: 5, content: "Nda yulula epito\nKu li lete nga?\nEnju lekolelo,\nAmolange.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_149, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2236, position: 1, content: "Okualuali o panda pi?\nYesu o ku yongola.\nOkuahali o lembua pi?\nYesu o ku yongola.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_150, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2237, content: "Suku wa ku sovola.\nYesu wa ku yovola.\nEnju kokua’e. Tava kokua’e.\nEnju ku Ñala Yesu.\nEnju kokua’e. Tava kokua’e.\nEnju ku Ñala Yesu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_150, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2238, position: 2, content: "Okuetavo wa kuama pi?\nYesu o ku yongola.\nOkuetavo wa saka pi?\nYesu o ku yongola.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_150, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2239, position: 3, content: "Okuesunga o tunga pi?\nYesu o ku yongola.\nOkuakandu o wunda pi?\nYesu o ku yongola.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_150, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2240, position: 1, content: "Ovakandu a koka ohali,\nA kokavo oku fa luvali.\nHelie o tela oku popela?\nYesu, una tuo kolela.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_151, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2241, position: 2, content: "Va kolela Yesu ocili,\nHa vo kuama lolupili,\nEye o va imbila okuokuo.\nKa vo yanduluka kotoko.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_151, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2242, position: 3, content: "Vo kolela va tiamela\nKolondunge Yesu a va iha.\nVa limbuka esunga liavio,\nVa lisuñamaisa lavio.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_151, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2243, position: 4, content: "Vo kolela oloneke viosi\nVa kolapo palo posi.\nLo kovailu va sangavo\nYesu ocikolo cavo.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_151, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2244, position: 1, content: "Ha linga nye la Yesu?\nUtima wa pula.\nNdaleka Onjovoli?\nAle ndu likala?.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_152, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2245, content: "Yesu! Yesu!\nHa linga nye la Yesu?\nWa nalela ohali ya lua\nOku muisa omuenyo.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_152, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2246, position: 2, content: "Yesu Omõla a Suku\nEye o njovola.\nEtaili nola ocili\nNda he ndu yongola.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_152, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2247, position: 3, content: "Ha linga nye la Yesu?\nKameme ka Suku.\nNdu litavela cosi.\nNdombela ongusu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_152, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2248, position: 4, content: "Ndu wiha utima wange.\nNjelula ekulusu.\nNjimbapo ovitua vivi.\nNdu kuama lesanju.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_152, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2249, position: 1, content: "Ndove wa yongola omuenyo,\nUna ko pui pua.\nNdo kolele Ñala Yesu,\nEye o ku yovola.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_153, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2250, content: "Omuenyo ko pui\nNda wo yongola,\nTava ndopo Kupopeli.\nEye o kuyovola.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_153, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2251, position: 2, content: "Ovakandu a nonguisa\nA ku nyola ño.\nYesu wa ku sandiliya\nHa ka ku yelisa lie.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_153, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2252, position: 3, content: "Wa laika oku fa luvali.\nKu yokoka nga?\nNdo tilile ko Njovoli,\nOco ku fi vali mbu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_153, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2253, position: 4, content: "Yesu wa tu sola cimue,\nYu wa tu fila.\nWa tu vanjela omuenyo\nUna ko pui vali pua.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_153, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2254, position: 1, content: "Suku o ñovonga. Si yevi he?\nEsanju liange sanga pi?\nUtima he upekela?\nSi vanjiliya omuenyo nga?", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_154, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2255, position: 2, content: "Suku o ñovonga. Si yevi he?\nWa sola; ndu tombela nye?\nSi tava nga kondaka eyi?\nNye si tambuila ohenda ya'e?", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_154, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2256, position: 3, content: "Suku o ñovonga. Ndi lendela nye?\nNda ndi suma ndi pumba enene,\nOvina viaño ndi vi sia.\nOndaka yaye ndi yi yolela.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_154, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2257, position: 1, content: "Ku li ondotolo yinene,\nOnduko yaye Yesu.\nEye o sakula omanu\nVa vela ovakandu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_155, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2258, content: "Yesu, oyo onduko\nYusakuli wa piãla,\nOndotolo yohenda;\nYesu lika; Yesu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_155, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2259, position: 2, content: "Itima o vi petula;\nOnduko yaye Yesu.\nIhemba viaye ombembua,\nLohenda kuenda esanju.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_155, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2260, position: 3, content: "O tu sakola ocali;\nOnduko yaye Yesu;\nImula okufa luvali,\nHa tu kanguka kilu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_155, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2261, position: 1, content: "Ove hẽ okuetu, wa ile ku Yesu?\nWa sukuiwa vosonde yaye?\nOve he wa kolela esunga lia'e?\nWa sukuiwa vosonde yaye?", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_156, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2262, content: "Wa yua he vosonde?\nVosonde yina ya Kameme?\nKutima kua yela ndocikokoto?\nWa sukuiwa vosonde yaye?", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_156, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2263, position: 2, content: "Ove he o kasi oku enda lahe?\nWa sukuiwa vosonde yaye?\nO kasi lombembua vutima wove?\nWa sukuiwa vosonde yaye?", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_156, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2264, position: 3, content: "Eci ohueli yiya wenda kumue la'e\nWa sukuiwa vosonde yaye?\nWiñila kuvala lesanju lia lua?\nWa sukuiwa vosonde yaye?", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_156, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2265, position: 4, content: "Lula uwalo wa liña lovakandu.\nKo sukule vosonde yaye.\nOno yaco yu ku yelisa ocili.\nKa yelisue vosonde yaye.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_156, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2266, position: 1, content: "Ondaka yohenda,\nA Yesu, ndi sole.\nYi namba, njiya kokuove,\nSukule losonde.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_157, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2267, content: "Njiya kokuove.\nNjiya etali.\nNdo sukule kutima\nLosonde yeyovo.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_157, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2268, position: 2, content: "Si kuete ulambi,\nSi kuete ongusu.\nÑolela lika ocali\nCosonde ya Yesu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_157, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2269, position: 3, content: "Osonde yeyovo,\nLocali ca piãla,\nVi nyiha utima wuhãlo\nU tomba okufa.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_157, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2270, position: 1, content: "Tuala ku Yesu upongo wove.\nEye o ku muisa elembeleko,\nHaeye o ku iha ombembua yaye.\nEye Ombindikiyo yocili.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_158, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2271, content: "Enju ku Yesu. Enju ku Yesu.\nEye o linga Ekamba liove.\nEnju ku Yesu. Enju ku Yesu.\nEye Ombindikiyo Yocili.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_158, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2272, position: 2, content: "Tuala ku Yesu esumuo liove\nO piñainyapo esanju liaye.\nOku kolisa lohenda yaye.\nEye Ombindikiyo yocili.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_158, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2273, position: 3, content: "Tuala ku Yesu itangi viove.\nEye o ku imula ohele yosi.\nO ku lembuisa ayonjo osi.\nEye Ombindikiyo yocili.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_158, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2274, position: 1, content: "Tu imbi lesanju ohenda ya piãla;\nOyo yocili, Oyo yocili.\nYina ya lova vutima wa Tate,\nHayo ya loña kokuetu.\nYa lua ohenda, hayo yocili,\nYi li vutima wa Tate kovailu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_159, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2275, position: 2, content: "Yesu wa tunda kulamba wa piãla.\nWeya lesanju. Weya lesanju,\nHa tu sapuila ohenda ya Suku,\nNdomo ya lova komanu.\nTua pambukile; Wa tu landula,\nWa tu wilisa vonjila yomuenyo.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_159, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2276, position: 3, content: "Toke etali haimo o tu sandela.\nNye tu lueyela? Nye tu lueyela?\nO tu livela nda tuiya kokuaye,\nHa tu kokela keyovo.\nTu si okufa. Tu endi komuenyo,\nHa tu tambula elau liovutima.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_159, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2277, position: 4, content: "Enju kokuange, a Henda ya piãla.\nKu ka sie vali. Ku ka sie vali.\nOco suvuke ovitua via viha\nLoku likisa esunga.\nNundise kuvi, njele kutima,\nSi limbukiwa, a Yesu, ndu wove.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_159, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2278, position: 1, content: "Nda ku yeva wa ñovonga;\nWa ñovonga, a Ñala yange.\nNda ku yeva, kuenje huti,\nEkulusu liove li tikula.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_160, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2279, content: "Nda tikula ekulusu.\nNdi ku kuãi, a Ñala yange.\nO songuila; ndi ku kuama.\nNdi ku kuama kuosi o songuila.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_160, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2280, position: 2, content: "Ndo songuile, a Ñala yange.\nNdo njelise, a Cinyi cange.\nNda ñupuka, a Henda, ñuate.\nEkulusu liange li njelule.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_160, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2281, position: 3, content: "Ndaño kuosi ku tekava,\nNdaño ekavo liange lia lua,\nHaimo ngenda, si yokoka.\nEkulusu liange ndi tikula.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_160, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2282, position: 1, content: "Yesu oyo onduko yaco\nYa  eciwile komanu,\nOku lipopela layo\nHa va moli kovailu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_161, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2283, content: "Oyo fu, komanu,\nYi va muisa ongusu;\nOyo fu kovailu,\nYesu oyo onduko fu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_161, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2284, position: 2, content: "Endaendi londuko Yesu,\nYi kolisa omanu;\nYi teyula kovayonjo,\nYi lemela akandu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_161, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2285, position: 3, content: "Ya posoka onduko yaco\nYi tu muisa muele utoi;\nYi tu luisa ekolelo;\nYi tundisa pe osoi.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_161, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2286, position: 4, content: "Liluki onduko Yesu\nKolonduko oyo fu;\nYa kemala kovangelo\nYi soliwe lomanu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_161, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2287, position: 1, content: "Vosi wa yeviko, vilikiyi.\nSandeki olondaka kuosi koluali.\nImbili olonguiya vina viocili:\nVeye vosi va panga.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_162, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2288, content: "Yeveleli ya! Yeveleli ya!\nYesu o tambula vosi va panga\nSuku Tate yetu o va kovonga:\nVeye vosi va panga.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_162, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2289, position: 2, content: "Vosi wa yeviko, ko ka sumi;\nVosi wa yeviko, enjui etali;\nYesu eye onjila yetu lika wa’e:\nVeye vosi va panga.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_162, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2290, position: 3, content: "Vosi wa yeviko, u lendela nye?\nVosi wa yeviko, ko ka taluki.\nYesu eye epito li li upulule:\nVeye vosi va panga.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_162, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2291, position: 1, content: "Epito lina liokilu\nLi kasi upulule,\nÑala Yesu lohenda ya’e,\nWa lalekamo vosi.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_163, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2292, content: "Yesu ukuahenda ka yi pui,\nEpito wa njuluila ame.\nAme, ame,\nWa njuluila ame.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_163, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2293, position: 2, content: "Epito li li upulule\nWa panga iñilamo,\nOhukui yaño lohuasi\nVa sangelamo omuenyo.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_163, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2294, position: 3, content: "Akuetu tu yayuliko\nTu iñili vosi kumue,\nEpito sanga li yikua\nVa lenda va ka pumba.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_163, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2295, position: 1, content: "Ku ka pañele, okuetu,\nKu ka tave ño levando;\nYesu o yongola oku eca\nUlamba ko pui womuenyo.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_164, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2296, content: "Tava; tava;\nTava ku Yesu ndopo.\nTava; tava;\nTava ku Yesu ndopo.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_164, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2297, position: 2, content: "Ku li onganyu ye, okuetu,\nKomuenyo wakulo waño?\nKa ku li onganyu yocili,\nTe eyi yomuenyo ko pui.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_164, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2298, position: 3, content: "Vutima ku yevi, okuetu,\nElungulo li Espiritu?\nNdo tave kondaka yohenda,\nKu tila ohali yakandu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_164, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2299, position: 4, content: "Ku ka pañele, okuetu,\nOtembo yi li oku pita,\nOmbili yi koka omuenyo,\nOwesi u koka okufa.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_164, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2300, position: 1, content: "Yeva ekovongo\nLionjovoli yove.\nTava kocisola\nCa ku vilikiya.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_165, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2301, position: 2, content: "Ocisola caye\nCu ku ohela kuosi,\nKuenda ci leluisa\nOvitele viosi.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_165, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2302, position: 3, content: "Nda wa sakalala\nEye o ku lemba.\nHaeye o ku muisa\nOnjolela ya lua.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_165, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2303, position: 4, content: "Yesu o yelisa\nOlonjila viove.\nHaeye o ku lava\nOloneke viosi.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_165, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2304, position: 5, content: "Ku ka lipumbise.\nTava ku Ukuahenda.\nO ku taiyilili\nLocisola ca lua.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_165, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2305, position: 1, content: "Yesu o tambula omanu,\nNdaño ame ndukuakandu.\nO njelisa pe kutima,\nO nyiñisa kuwa wa’e.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_166, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2306, content: "Litavela, Litumbika\nOku iñila kuwa wa’e,\nLitavela litumbika\nOku iñila kuwa wa’e.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_166, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2307, position: 2, content: "Vakuakandu o va tambula\nNda va tava kelaleko,\nHa va sipo cosi civi,\nO va iñisa kuwa wa’e.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_166, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2308, position: 3, content: "Yesu, akuetu, wo laleki.\nKo ka tombi ondaka yaye.\nKo ka lipumbisi vali.\nEnjui ndopo kuwa wa’e.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_166, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2309, position: 1, content: "Yesu weyile ko Mbeteleme\nKusuke, kohali lokepembe.\nWa ci lingila ocisola ca lua\nOku sanda ame,\nOku sanda ame,\nOku sanda ame.\nWa ci lingila ocisola ca lua\nOku sanda ame.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_167, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2310, position: 2, content: "Yesu wa fila komindikiso\nCosi wa feta ha muisa eyovo.\nNda si oku fa, wa muisa omuenyo\nPoku fila ame,\nPoku fila ame,\nPoku fila ame,\nNda si oku fa, wa muisa\nomuenyo\nPoku fila ame.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_167, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2311, position: 3, content: "Yesu o tiuka eteke limue\nOku kovonga omanu vaye.\nIya lulamba wa piãla enene\nOku njupa ame,\nOku njupa ame,\nOku njupa ame.\nIya lulamba wa piãla enene\nOku njupa ame.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_167, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2312, position: 1, content: "Enjui, wa lemiwi, vitima viene\nNdo kekameli komangu yohenda.\nEnjui, wa suvali; tu li itima;\nKa ku li esumuo ka li pui kilu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_168, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2313, position: 2, content: "Enjui wa keletui; wa sipatiwi;\nNdo kekameli komangu yohenda.\nEnjui, wa silihui; tu li itima;\nKa ku li esumuo ka li pui kilu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_168, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2314, position: 3, content: "Enjui, wa konyohi, wa takumuiwi;\nNdo kekameli komangu yohenda.\nEnjui, wa pembuiwi; tu li itima\nKa ku li esumuo ka li pui kilu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_168, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2315, position: 4, content: "Enjui, wa sukilui ku Cime cene;\nNdo kekameli komangu yohenda.\nEye Usakuisi; Tu li itima:\nKa ku li esumuo ka li pui kilu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_168, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2316, position: 5, content: "Enjui vu Usoma waye; Enjui kesanju\nNdo lembelekiwi kupongo wosi.\nLi ombolo yomuenyo yo talameli;\nKa ku li upongo ka u pui kilu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_168, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2317, position: 1, content: "Wa kamba naito, poku tava,\nWa kamba naito, haimo o sumua;\nKu ka ci popie ño,\nNundeko, a Spiritu;\nEteke kovaso\nHu kovonga.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_169, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2318, position: 2, content: "Wa kamba naito. Enju etali.\nWa kamba naito. Ku ka sume.\nYesu wa ku laleka,\nAngelo va ku payula,\nLetu tu ku lombela,\nEnju etali.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_169, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2319, position: 3, content: "Wa kamba naito, puãi wa pumba!\nWa kamba naito; haimo o ka pia!\nNaito ka yi tela,\nNaito yi sumuisa;\nKu iya oku livela,\nWa nyelela!", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_169, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2320, position: 1, content: "Yeva ondaka ya Yesu,\nÑuame ame. Enju, o ñuame;\nKomuenyo wove husonguila.\nÑuame ame. Enju, o ñuame;\nOvihandeleko nda tava.\nOmo liove ondulu nda nyua\nOmo liove ame nda fa;\nÑuame ame. Enju, o ñuame.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_170, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2321, position: 2, content: "Vokuange ove opuyuka;\nÑuame ame. Enju, o ñuame;\nOvitangi viove vieca.\nÑuame ame. Enju, o ñuame;\nAme Suku hu popela,\nAme hu sole, ukuakandu\nSia ohele yove yakandu;\nÑuame ame. Enju, o ñuame.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_170, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2322, position: 3, content: "Oco hukuama a Yesu;\nHukuama, oco, hukuama;\nOmo liove ndisia viosi\nNdi visia. Oco ndi visia.\nNda hongua sisilivila;\nA Ñala ñuatise okuenda,\nOco njukise ongusu yove.\nHu kuama. Oco, hu kuama.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_170, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2323, position: 1, content: "Yesu o kasi oku kovonga\nWa kovonga ove, lame;\nEye puvelo okutayilili,\nOku tata ove, lame.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_171, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2324, content: "Enju, Enju!\nOve wa kava enju!\nYesu o kasi oku ku kovonga;\nOkuakandu, enju ya.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_171, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2325, position: 2, content: "Yesu olaleka, ka tu ka taluki\nWa tu laleka ove lame;\nKu ka pembule elaleko liaco\nAku iha ove, lame le.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_171, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2326, position: 3, content: "Vievi vi pita oloneke vietu,\nVi u ku pita ove, lame;\nKufa o kasi oku tu lavoka,\nOku lavoka ove lame.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_171, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2327, position: 4, content: "Vanja ocisola Yesu a tu kuetele;\nOceca kokuove, lame;\nOco tu tunde kupika wakandu\nWanjiyilila ame love.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_171, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2328, position: 1, content: "Esapulo eli lia posoka,\nLia kameme ka Suku,\nUna wa sia ulamba wahe\nOku yovola omanu.\nHelie wa yovola oluali?", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_172, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2329, content: "- Yesu wa nena eyovo.\nNye a fila? \n- Okupopela.\nOkasi pi?\n- Yu kovailu.\nYu kovailu oku lavoka", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_172, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2330, position: 2, content: "Ka kuli Ungelo wa seteka,\nKo ciñyi cenda ño hu.\nEci Yesu a tu lekisa\nOku fila omanu vahe.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_172, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2331, position: 3, content: "Otava okuetu ku Upopeli?\nLieca kokuahe etaili\nNdo tave kocisola cahe\nOmo eye oku yongola.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_172, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2332, position: 1, content: "Yesu o kasi locisola,\nWa ngecela cosi pe.\nNda nyelile, wa ngalula,\nWa nulila omuenyo wa’e.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_173, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2333, position: 2, content: "Ale utima wa tilile,\nSia yevele ondaka ya’e.\nEye wa yi situluila;\nSia siluile vali mbu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_173, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2334, position: 3, content: "Ale nda huvikiwile;\nSia litumbikile sio.\nSia solele Ñala Yesu,\nCilo si tatãla mbu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_173, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2335, position: 4, content: "Nda yokokelele okufa,\nWa ñolisa utima ngo.\nOmo a fila kekulusu,\nSi yokoka vali mbu.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_173, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2336, position: 5, content: "Nda komoha ohenda yaye,\nLomue wa lisoka la’e.\nCoku tiula si ci moli,\nTe ndi vumba omanu va’e.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_173, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2337, position: 1, content: "Oku lila ka ku yovola.\nNdaño lasuelela alua,\nKakuli eci ci tela\nOku sukula ame;\nOku lila ka ku yovola.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_174, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2338, content: "Yesu wa tala ohali;\nKekulusu wa fila ame;\nOsonde ya'e ya peseka\nNdoco ci tava onjovola.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_174, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2339, position: 2, content: "Upange ka u njovola\nLepandi lienda ño hu,\nKali tela oku njovola,\nNdaño akandu acelua;\nUpange ka u njovola.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_174, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2340, position: 3, content: "Yesu eye o yovola\nEye upange wa u suisa,\nAkandu ange wa va ecela,\nLosonde ya'e wa ngecela;\nYesu eye o yovola.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_174, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2341, position: 1, content: "Ulo owanji wa Ñala; aleluya,\nOndaka yukuahenda: Suku;\nÑala opopela ukuakandu; aleluya,\nUpopela ño, oku uvanja.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_175, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2342, content: "Vanji avamanji vanji\nTulukili Yesu;\nEye opopela ukuakandu; aleluya\nUpopeli ño, oku  uvanja!", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_175, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2343, position: 2, content: "Wa feta ofuka yene; aleluya!\nWa yi telisa kekulusu;\nOmuenyo waye waeca; aleluya,\nOco olekasi ku Suku.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_175, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2344, position: 3, content: "Ocilumba eci cene; aleluya!\nComuenyo wenda ño hu kilu;\nImbi ovaso ku Yesu; aleluya!\nKumbululi lonjanga Suku.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_175, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2345, position: 4, content: "Tavi ya kepopelo; aleluya!\nKuami olomahi via Ñala;\nPitiyi ongecelo ya'e; aleluya!\nOyo ondaka yu Upopeli,", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_175, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2346, position: 1, content: "Ñala Yesu ndo sukila,\nSi tela oku enda ulika.\nEye muele okasi lame,\nPeka liange a ñuata.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_176, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2347, content: "Uvi siu yokokela,\nKuoha a panga a songuile.\nNgenda ño si lisiõsiõla,\nLoku u kuama volomai.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_176, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2348, position: 2, content: "Ñala Yesu ndo sukila,\nEye o nyiha ongusu,\nHaye o tela oku njulisa,\nLomue wiñi o nela.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_176, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2349, position: 3, content: "Ñala Yesu ndo sukila,\nVungende ulo womuenyo,\nKovakimba ovayonjo,\nLokonjuela lupongo!", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_176, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2350, position: 4, content: "Ñala Yesu ndo sukila,\nLiso liahe o songuila,\nTe ha sanga olui Yordão\nLonjiva yaco njoka.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_176, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 2351, position: 1, content: "Akuetu tua lalekua\nOku litumbika ocili,\nKu Yesu Cime cetu.\nTu ci lingi etali.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_177, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2352, content: "Tu ci lingi etali.\nTu ci lingi etali.\nKuatiko lekolelo.\nTu ci lingi etali.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_177, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 2353, position: 2, content: "Akuetu, tua lalekua\nOku ambata ekulusu.\nLituiki lekolelo.\nTu ci lingi etali.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_177, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2354, position: 3, content: "Akuetu, tua lalekua\nOku linga olombangi\nViondaka yepopelo.\nTu ci lingi etali.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_177, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 2355, position: 4, content: "Akuetu, tua lalekua\nOku sanjukila eyovo.\nEsumuo liosi li pue.\nTu ci lingi etali.", hymnsNumber: UmHymnsNumberSeeder.OKU_TAVISA_UKUEKANDU_177, typeStanza: HymnsContentCode.VERSE),
  ];
}